'use strict';
const corpusArray=setCorpus();
const inputStrings = document.getElementById("input_text_area");
const resultDivided = document.getElementById("result-area");
//resultDivided.value = inputStrings + "文字列を追加したよ";

inputStrings.oninput = function handleInput(e) {
  const string = reverseStrings(doEscapeProcessing(e.target.value));
  const {matchedArray,targetArray}=searchWords(string);
  let resultArray = [];
  resultArray=resultArray.concat(matchedArray,targetArray);
  console.log(JSON.stringify(resultArray));
  const resultHTML = generateHTML(resultArray,string);

  resultDivided.innerHTML = resultHTML;
}

function generateHTML(arr,string){
  const emphasizeTag1 = '<font color="mediumblue"><strong> ', emphasizeTag2=' </strong><font>';
  const normalTag1 = '<font color="black">', normalTag2='<font>';
  let resultHTML = "";

  arr.sort(function(a,b){
    return a.headIdx-b.headIdx;
  });
  console.log(JSON.stringify(arr));

  //TODO テスト
  //headIdxが-1の要素を全て削除する
  for(let i=0; arr[i]["headIdx"] === -1; i++){
    arr[i].pop;
    }
  
  for(let i=0; i<arr.length; i++){

    const tag1=arr[i]["matched"] ? emphasizeTag1 : normalTag1;
    const tag2=arr[i]["matched"] ? emphasizeTag2 : normalTag2;
    const word=string.slice(arr[i]["headIdx"],arr[i]["tailIdx"]+1);

    resultHTML = resultHTML + tag1 + word+ tag2;
  }

  return resultHTML;

}

function doEscapeProcessing(string){
  let array = [];
  let length = string.length
  let char;
  for (let i = 0; i < length; i++) {
    switch (string.substr(i,1)){
      case ">" :
        char = reverseStrings("&lt;");
        break;
      case "<" :
        char = reverseStrings("&gt;");
        break;
      default:
        char = string.substr(i,1);
    }
    array.push (char);
  }
  return array.join("");
}

function reverseStrings(string) {
  let array = [];    
  let length = string.length
  const smallChar=['ぁ','ぃ','ぅ','ぇ','ぉ','っ','ゃ','ゅ','ょ','ゎ','ゕ','ゖ','ァ','ィ','ゥ','ェ','ォ','ヵ','ㇰ','ヶ','ㇱ','ㇲ','ッ','ㇳ','ㇴ','ㇵ','ㇶ','ㇷ','ㇷ゚','ㇸ','ㇹ','ㇺ','ャ','ュ','ョ','ㇻ','ㇼ','ㇽ','ㇾ','ㇿ','ヮ'];
  for (let i = length-1; i >= 0; i--) {
    if (smallChar.includes(string.substr(i,1))){
      array.push (string.substr(i-1,1));
      array.push (string.substr(i,1));
      i=i-1;
    }else{
      array.push (string.substr(i,1));
    }
    }
  return array.join("");
};

function getMaxLength(){
  const corpus=setCorpus();
  let maxLength=0;
  corpus.forEach( element =>{     
    if (element.length>=maxLength){
      maxLength=element.length;
    }
  });
  return maxLength;
};

function searchWords(reversed){  
  const maxCorpusLength = getMaxLength();  
  const maxKeywordLength = maxCorpusLength < reversed.length ? maxCorpusLength: reversed.length;  
  let searchString;
  let tempTailIdx;
  let h=0;
  let targetArray=[], matchedArray=[];
  let corpus=setCorpus();
  //reversed全体を検索領域とする。matchedは全てfalse(machedArrayはmatchedが全てtrue)
  targetArray[0]={matched: false, headIdx: 0, tailIdx: reversed.length-1};
  
  //検索対象がひらがな表記の為、reversed中のカタカナはひらがなに変換してから検索する
  reversed=reversed.replace(/[ァ-ン]/g,function(s){
    return String.fromCharCode(s.charCodeAt(0) - 0x60);
  });

  for (let searchWordLength = maxKeywordLength; searchWordLength>1; searchWordLength--){

    console.log('searchWordLength: '+ String(searchWordLength));

    for (let i=0; i<targetArray.length; i++){ 

        for (let t = targetArray[i]["headIdx"] + searchWordLength-1, h = targetArray[i]["headIdx"]; t <= targetArray[i]["tailIdx"]; t++){

        //searchStringに値をセット
        h = t-searchWordLength+1;//searchStringのhead
        
        searchString = reversed.slice(h, t+1);
        //searchString = reversed.slice(targetArray[i][headIdx],targetArray[i][tailIdx]+1);

        if (corpus.includes(searchString)){
          //検索が成功した場合はmatchedArrayに要素を追加する
          matchedArray.push(
            {matched: true, headIdx: h, tailIdx: t}
          );

          //targetArrayの更新

          //検索領域と、マッチ領域が完全に一致した場合は各Idxに-1を入れることで検索領域の要素を削除したと見なす
          if ((h===targetArray[i]["headIdx"])&&(t===targetArray[i]["tailIdx"])){
            targetArray[i]["headIdx"]=-1;
            targetArray[i]["tailIdx"]=-1;

            //検索領域の先頭(headIdx)とマッチ領域の先頭(h)が等しい場合
          } else if (h===targetArray[i]["headIdx"]){

            //検索領域の先頭をマッチ領域の末尾+1に変更する
            targetArray[i]["headIdx"]=t+1;
            
            //検索領域の末尾(tailIdx)とマッチ領域の末尾(t)が等しい場合
          } else if (t===targetArray[i]["tailIdx"]){

            //検索領域の末尾をマッチ領域の先頭-1に変更する
            targetArray[i]["tailIdx"]=h-1;
          
            //検索領域とマッチ領域それぞれの先頭同士、末尾同士がいずれも等しくない場合
          } else {//(h!==targetArray[i]["headIdx"])&&(t!==targetArray[i]["tailIdx"]))

            //検索領域の末尾をマッチ領域の先頭-1に変更することでマッチ領域の左側に検索領域をセット
            tempTailIdx=targetArray[i]["tailIdx"];
            targetArray[i]["tailIdx"]=h-1;

            //検索領域を追加。先頭をマッチ領域の末尾+1、末尾をtargetArrayの末尾とすることでマッチ領域の右側に検索領域をセット
            targetArray.push({matched: false, headIdx: t+1, tailIdx: tempTailIdx});
          }
            //マッチ領域の分tをスキップする
            t=t+(t-h);
        };  
        }
      }
      }
      return {matchedArray,targetArray};    
    }

